(20, 'Zutaten für die Eierspätzle so lange schlagen, bis Luftblasen entstehen. Teig ca. 10 Minuten ruhen lassen, nochmals schlagen. Der Teig sollte sich ziehen lassen ohne zu reißen.', 15, 1, NULL, 4);
