(21, 'Einen Topf mit kochendem Salzwasser aufsetzen. Den Teig reinschaben oder mit einer Spätzlepresse in das Wasser drücken. Die Spätzle einmal kochen lassen, die oben schwimmenden Spätzle mit eine Schaumlöffel abschöpfen.', 5, 2, NULL, 4);
INSERT IGNORE INTO `preperation_step` (`pre_step_id`, `description`, `effort`, `step_count`, `pic_id`, `rezept_id`) VALUES
